import React, { useState } from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import './PaymentPage.css';

const PaymentPage = () => {
  const navigate = useNavigate();
  const location = useLocation();
  const { selectedPackage, peopleCount, pickupTime, guideLanguage, totalCost } = location.state || {};

  const [orderId, setOrderId] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [paymentStatus, setPaymentStatus] = useState('');

  // Redirect if no package data
  if (!selectedPackage) {
    navigate('/');
    return null;
  }

  const createOrder = async () => {
    try {
      const response = await fetch('http://localhost:5000/create-order', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({
          amount: totalCost,
          packageName: selectedPackage.name,
        }),
      });
      const data = await response.json();
      if (data.orderId) {
        setOrderId(data.orderId);
      } else {
        console.error('Failed to create order:', data);
      }
    } catch (error) {
      console.error('Error creating order:', error);
    }
  };

  const handlePayNow = async () => {
    if (!orderId) {
      setIsLoading(true);
      await createOrder();
      setIsLoading(false);
    }

    if (orderId) {
      // Corrected 50% chance condition
      const isPaymentSuccessful = Math.random() > 0.5;
      const paymentStatus = isPaymentSuccessful ? 'success' : 'failed';

      const response = await fetch('http://localhost:5000/verify-payment', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ orderId, paymentStatus }),
      });

      const data = await response.json();

      if (data.status === 'success') {
        setPaymentStatus('Payment successful!');
        alert('Payment was successful!');

        navigate('/paymentconfirmation', {
          state: {
            selectedPackage,
            peopleCount,
            pickupTime,
            guideLanguage,
            totalCost,
            orderId,
            paymentStatus: 'Payment successful!',
          },
        });
      } else {
        setPaymentStatus('Payment failed. Please try again.');
        alert('Payment failed. Please try again!');
      }
    }
  };

  return (
    <div className="payment-page">
      <div className="payment-container">
        <h1>Payment Page</h1>
        <div className="payment-details">
          <h3>Package Details:</h3>
          <p><strong>Package:</strong> {selectedPackage.name}</p>
          <p><strong>Pickup Time:</strong> {pickupTime}</p>
          <p><strong>Number of People:</strong> {peopleCount}</p>
          <p><strong>Guide(Lang):</strong> {guideLanguage}</p>
          <p><strong>Total Cost:</strong> â‚¹{totalCost}</p>
        </div>

        <div className="payment-actions">
          {isLoading ? <p>Loading order...</p> : <button onClick={handlePayNow}>Pay Now</button>}
        </div>

        {paymentStatus && <div className="payment-status">{paymentStatus}</div>}
      </div>
    </div>
  );
};

export default PaymentPage;
